import logo from './logo.png';
import './App.css';

function App() {
  return (
    <Header />
  );
}

function Header(){
  const tituloApp = "Hoje aprendi!"

  return(
    <header className="header">
      <div className="logo">
        <img src="./logo.png" height="68" width="68" alt="Logo Hoje Aprendi" />
        <h1>{tituloApp}</h1>
      </div>
    </header>
  )
}

export default App;
